import {Card,Button} from "react-bootstrap";

const Carde = (props) => {

    return (

        <>
        <a className="" href="/laptop">
            <Card style={{ width: '12rem' }}>
                <Card.Img variant="top" src="holder.js/100px180" />
                <Card.Body>
                    <Card.Title>{props.title}</Card.Title>
                    <Card.Text>
                        {props.description}
                    </Card.Text>
                </Card.Body>
            </Card>
            </a>
        </>
    )
}

export default Carde;
